import React from 'react'
import cl from './MyButton.module.css'

export default function MyButton() {
  return (
    <button className={cl.myBtn}>
        <img src="https://img.icons8.com/ios-glyphs/30/FA5252/delete-sign.png"/>
    </button>
  )
}
